import React from 'react';
import s from './Navbar.module.css'

const Navbar = () => {
    return (
        <div>
            <a href="#" className={s.logo}>e-board</a>
            <input type="text" value={'search'}/>
            <button type={"button"} value={'Поиск'}/>
            <button value={'Разместить объявление'}/>
            <button/>
        </div>
    );
};

export default Navbar;
